    [TestMethod]
    public void Day04_1_Dummy()
    {
        var result = AdventOfCode2024Lib.Day04_1(Day04_Dummy);
        result.Should().Be(18);
    }
    
    [TestMethod]
    public void Day04_1_Final()
    {
        var result = AdventOfCode2024Lib.Day04_1(Day04_Final);
        result.Should().Be(18); //2761, zu hoch
    }
    
    [TestMethod]
    public void Day04_1_SaveCalc()
    {
        AdventOfCode2024Lib.SaveCalc(-1,10).Should().Be(9);
        AdventOfCode2024Lib.SaveCalc(-2,10).Should().Be(8);
        AdventOfCode2024Lib.SaveCalc(-3,10).Should().Be(7);
        AdventOfCode2024Lib.SaveCalc(0,10).Should().Be(0);
        AdventOfCode2024Lib.SaveCalc(2,10).Should().Be(2);
        AdventOfCode2024Lib.SaveCalc(5,10).Should().Be(5);
        AdventOfCode2024Lib.SaveCalc(9,10).Should().Be(9);
        AdventOfCode2024Lib.SaveCalc(10,10).Should().Be(0);
        AdventOfCode2024Lib.SaveCalc(11,10).Should().Be(1);
        AdventOfCode2024Lib.SaveCalc(12,10).Should().Be(2);
    }

